import React from 'react';
import './Css/Nav.css'
import logo from './Images/HobLogo.jpg';
import 'bootstrap/dist/css/bootstrap.min.css';

function Nav() {
  return (
    <nav>
      <div class="container">
        <div class="row">
          <div class="col-1">
            <img src={logo} className="logo" />
          </div>
          <div class="col-11">
            <ul className="nav-links">
              <li>Home</li>
              <li>Us</li>
              <li>Login</li>
            </ul>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Nav;
